// src/Pages/Page2.js
import React from 'react';
import { Link } from 'react-router-dom';
import './Page2.css';

const Page2 = () => {
  return (
    <div className="page2-container">
      <div className="story-container">
        <div className="story-text">
          <h2>Once upon a time, a boy named Adarsh met a girl who stole his heart...</h2>
          <p>To prove his love and unlock the final surprise, you must help him complete a few fun challenges!</p>
        </div>
        <div className="mystery-box">
          <Link to="/games">
            <button className="continue-btn">Continue</button>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Page2;
